		job_description:
			"Full Stack Senior Software Engineer/Developer\n\nAbout Company Statement:\n\nS&P Global delivers essential intelligence that powers decision making. We provide the world's leading organizations with the right data, connected technologies and expertise they need to move ahead. As part of our team, you'll help solve complex challenges that equip businesses, governments and individuals with the knowledge to adapt to a changing economic landscape.\nS&P Global Market Intelligence partners with customers to broaden their perspective and operate with confidence by bringing them leading data sources and technologies that embed insight in their daily work.\n\nNow About the Role:\n\nThe Role : Full Stack Senior Engineer/Developer\n\nThe Location : U.S. remote or Canada remote\n\nThe Team :\nAs a member of the S&P Global Market Intelligence Technology team, you will work with a group of intelligent and ambitious engineers . The team is responsible for the architecture, design, development, quality and maintenance of the next-generation real-time financial data web platform. Other responsibilities include transforming product requirements into Technical Design/ Implementation & writing technical requirements.\n\nThe Impact :\nWould you like to be part of the team that builds next generation real-time financial data products & platform? Join us and contribute significantly to the growth of the firm by:\n\n• Developing innovative functionality in existing and new products\n• Supporting and maintaining high revenue productionized products\n• Achieve the above intelligently and economically using best practice\n\nWhat's in it for you :\n• This is the place to hone your existing software development skills while having the chance to become exposed to latest cutting-edge technologies available in the market. Alongside you get opportunities to:\n• Mentor and work with a skilled team while shaping the future of our products.\n• Build a next generation UI financial product that consumers can rely on in order to take their financial decisions.\n• Opportunity to work on next generation real-time streaming data product from backend perspective.\n• Expand experience with modern cutting-edge technologies like Streaming technologies, Dev Ops, and cloud technologies.\n• Willingness to learn & master new technologies. We cross train team members, for versatile Full Stack experience. Responsibilities :\n• Complete SDLC: architecture, design, development and support of tech solutions\n• Active participation in all scrum ceremonies, follow AGILE best practices effectively.\n• Play a key role in the development team to build high-quality, high-performance, scalable code\n• Produce technical design documents and conduct technical walkthroughs\n• Document and demonstrate solutions using Technical design docs, diagrams and stubbed code\n• Work collaboratively with business partners to understand and clarify requirements.\n• Collaborate effectively with technical and non-technical stakeholders\n• Design and develop industry-leading applications.\n• Respond to and resolve production issues. What We're Looking For :\n• Bachelor's degree in Computer Science, Information Systems or Engineering.\n• 5+ years of significant experience in Application Development.\n• Minimum of 1 year (2+ years preferred) experience in working React JS.\n• Minimum of 1 Year (2+ years preferred) experience in working with Typescript.\n• Experience in implementing Unit Tests for JavaScript frameworks.\n• Superior knowledge of system architecture, object-oriented design, and design patterns.\n• Knowledge of object-oriented design, Cross-browser Compatibility, Responsive UI\n• Good understanding of Design Principles & excellent communication skills\n• Proficient with software development lifecycle (SDLC) methodologies like Agile, Test-driven development\n• Strong problem-solving skills\n• Agile/Scrum experience Nice To Have :\n• Experience working in AWS, Kubernetes, Docker etc.\n• AWS Certified\n• Ability to train and mentor. This role is limited to persons with indefinite right to work in the United States.\n\nCompensation/Benefits Information (US Applicants Only):\n\nS&P Global states that the anticipated base salary range for this position is $76,500 - $131,507. Base salary ranges may vary by geographic location.\n\nIn addition to base compensation, this role is eligible for an annual incentive bonus/a sales commission plan.\n\nThis role is eligible to receive additional S&P Global benefits. For more information on the benefits, we provide for our employees, visit https://spgbenefits.com/\n\nGrade/Level ( relevant for internal applicants only ): 10\n\nEqual Opportunity Employer\nS&P Global is an equal opportunity employer and all qualified candidates will receive consideration for employment without regard to race/ethnicity, color, religion, sex, sexual orientation, gender identity, national origin, age, disability, marital status, military veteran status, unemployment status, or any other status protected by law. Only electronic job submissions will be considered for employment.\nIf you need accommodation during the application process due to a disability, please send an email to: EEO.Compliance@spglobal.com and your request will be forwarded to the appropriate person.\n\nThe EEO is the Law Poster http://www.dol.gov/ofccp/regs/compliance/posters/pdf/eeopost.pdf describes discrimination protections under federal law.\n\n-----------------------------------------------------------\n\nEqual Opportunity Employer\nS&P Global is an equal opportunity employer and all qualified candidates will receive consideration for employment without regard to race/ethnicity, color, religion, sex, sexual orientation, gender identity, national origin, age, disability, marital status, military veteran status, unemployment status, or any other status protected by law. Only electronic job submissions will be considered for employment.\n\nIf you need an accommodation during the application process due to a disability, please send an email to: EEO.Compliance@spglobal.com and your request will be forwarded to the appropriate person.\n\nUS Candidates Only: The EEO is the Law Poster http://www.dol.gov/ofccp/regs/compliance/posters/pdf/eeopost.pdf describes discrimination protections under federal law.\n\n-----------------------------------------------------------\n\n20 - Professional (EEO-2 Job Categories-United States of America), IFTECH202.1 - Middle Professional Tier I (EEO Job Group), SWP Priority - Ratings - (Strategic Workforce Planning)\n\nJob ID: 287255\nPosted On: 2023-06-13\nLocation: Charlottesville, Virginia, United States",
